import React from "react";
import styled from "styled-components";

const Profile = styled.div`
	margin-top: 3rem;
	padding: 0 1rem;
`;

const ProfileInfo = styled.div`
	display: flex;
	flex-direction: column;
	align-items: flex-start;
	-webkit-box-align: center;
`;

const ProfileLinkGroup = styled.div`
	display: flex;
	color: rgb(173, 181, 189);
`;

const AboutPresenter: React.VFC = () => {
	return (
		<div className="container">
			<div className="content-wrap">
				<Profile>
					<ProfileInfo>about</ProfileInfo>
					<span className="divider divider--thin" />
					<ProfileLinkGroup>여기에 링크들</ProfileLinkGroup>
				</Profile>
				<span className="divider divider--thick" />
			</div>
		</div>
	);
};

export default AboutPresenter;
